import React from 'react'
import CardList from './Cardlist';
import {cats} from './cats';
import SerachBox from './SearchBox'

const App = () =>{
   return(
       <div>
           <h1>Cattyfriends</h1>
           <SearchBox/>
           <CardList cats = {cats}/>
        </div>
    );
}
export default App;
